//SOURCE: https://stackoverflow.com/questions/6926016/nodejs-saving-a-base64-encoded-image-to-disk

imageBase64 = process.argv[2]; //This is the png image as a string received as a parameter

//var imageBase64 = 'data:image/png;base64,';

//var imageBase64 = 'data:image/jpeg;base64,';

if (imageBase64.startsWith('data:image/png'))
{
    console.log('png');
    var imageData = imageBase64.replace(/^data:image\/png;base64,/, "");  //Remove header data
    require("fs").writeFile("./app_server/controllers/signature.png", imageData, 'base64', function(err) {
        console.log(err);
    });
}
else if (imageBase64.startsWith('data:image/jpeg'))
{
    console.log('jpg');
    var imageData = imageBase64.replace(/^data:image\/jpeg;base64,/, "");  //Remove header data
    require("fs").writeFile("./app_server/controllers/signature.jpg", imageData, 'base64', function(err) {
        console.log(err);
    });
}
else
{
    console.log('Signature image not a JPEG or PNG file');
}
